  return (
    <div>
    <Box display="flex" flexDirection="column" alignItems="center" > 
    <Button 
    LinkComponent={ Link }
     to="/books" sx= {{ marginTop: 15, background:"" }} variant='contained'>     
     <Typography variant='h3'>  View All Books </Typography>
    </Button>

    </Box>
    </div>
  )
}

export default Home
